import React, {Fragment, useEffect, useState} from 'react';
import PropTypes from 'prop-types';
import {connect} from 'react-redux';
import {loadUser} from '../../actions/auth';
import Statement from './Statement';
import {initStatus} from '../../actions/financialmodelingprep';
import {getIncome} from '../../actions/financialmodelingprep';
import {getCashflow} from '../../actions/financialmodelingprep';
import {getBalance} from '../../actions/financialmodelingprep';
import {quarterlyStatements} from '../../actions/financialmodelingprep';
import {annualStatements} from '../../actions/financialmodelingprep';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import {createFilterOptions} from '@mui/material/Autocomplete';

const Financials = ({
    loadUser,
    getIncome,
    getCashflow,
    getBalance,
    quarterlyStatements,
    annualStatements,
    financials: {iloading, cloading, bloading, income, cashflow, balance, period},
    auth: {user},


}) => {

    const [ticker, setTicker] = useState("AAPL");

    useEffect(() =>{if(!user && loadUser());}, [user, loadUser]);

    useEffect(() =>{if(ticker && initStatus());}, [ticker]);

    useEffect(() =>{if(user && ticker && getIncome(ticker, period));}, [ticker, period, user, getIncome]);

    useEffect(() =>{if(user && ticker && getCashflow(ticker, period));}, [ticker, period, user, getCashflow]);

    useEffect(() =>{if(user && ticker && getBalance(ticker, period));}, [ticker, period, user, getBalance]);

    const filterOptions = createFilterOptions({
        matchFrom: 'start'
    });

    return ( 
    <Fragment>
        <div className="container">
            <h1 className="large text-primary">Financial Statements</h1>

            <br />
            <div className="input-bar">
                <Autocomplete
                    value={ticker}
                    onChange={(event, newValue) => {
                    setTicker(newValue);
                    }}
                    id="ticker-combo-box"
                    options={tickers}
                    filterOptions={filterOptions}
                    sx={{ width: 300 }}
                    renderInput={(params) => <TextField {...params} label="Enter a Stock Symbol" />}
                />
                <ul className="input-bar fs-title text-primary"> 
                    <li>
                        <span>TTM</span>
                    </li>
                    <li>&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp;</li>
                    <li>
                        {(period==="quarter") ? <div>Quarterly</div> :
                            <span onClick={quarterlyStatements}>Quarterly</span>
                        }
                    </li>
                    <li>&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp;</li>
                    <li>
                        {(period==="year") ? <div>Annual</div> :
                            <span onClick={annualStatements}>Annual</span>
                        }
                    </li>
                </ul>
            </div>
            
            <h2 className="fs-title text-primary">{ticker} Income Statement</h2>
            <Statement 
                loading={iloading}
                statementKeys={incomeKeys}
                statement={income}
                styles="fs-income"
            />
            
            <h2 className="fs-title text-primary">{ticker} Cashflow Statement</h2>
            <Statement 
                loading={cloading}
                statementKeys={cashflowKeys}
                statement={cashflow}
                styles="fs-cashflow"
            />
               
            <h2 className="fs-title text-primary">{ticker} Balance Sheet</h2>
            <Statement 
                loading={bloading}
                statementKeys={balanceKeys}
                statement={balance}
                styles="fs-balance"
            />

        </div>
    </Fragment>
  )
}

