    loadUser: PropTypes.func.isRequired,
    getIncome: PropTypes.func.isRequired,
    getCashflow: PropTypes.func.isRequired,
    getBalance: PropTypes.func.isRequired,
    quarterlyStatements: PropTypes.func.isRequired,
    annualStatements: PropTypes.func.isRequired,
    financials: PropTypes.object.isRequired,
